// https://leetcode.com/problems/longest-substring-without-repeating-characters/
/*
Given a string, find the length of the longest substring without repeating characters.

Examples:

Given "abcabcbb", the answer is "abc", which the length is 3.

Given "bbbbb", the answer is "b", with the length of 1.

Given "pwwkew", the answer is "wke", with the length of 3. Note that the answer must be a substring, "pwke" is a subsequence and not a substring.
*/
#include <iostream>

using namespace std;

class Solution {
int alpha[255];
int currMax = INT_MIN, currCount = 0;
public:
    int lengthOfLongestSubstring(string s) {
        if (!s.size()) return 0;
        for(unsigned long i = 0; i < s.size(); i++) {
            currCount = 0;
            memset(alpha, 0, sizeof(alpha));
            for (unsigned long j = i; j < s.size(); j++) {
                int idx = s[j] - ' ';
                if (idx < 0) {
                    cout << "<<<<<< idx: " << idx << ": " << s[j] << endl;
                    exit(1);
                }
                if (alpha[idx]) {
                    if (currMax < currCount) {
                        currMax = currCount;
                        cout << "1. Found new currMax: " << currMax << endl;
                    }
                    break;
                } else if(j == s.size()-1) {
                    currCount++;
                    if (currMax < currCount) {
                        currMax = currCount;
                        //cout << "2. Found new currMax: " << currMax << " substring: " << s.substr(i, j-i+1) << endl;
                        cout << "2. Found new currMax: " << currMax << endl;
                    }
                } else {
                    alpha[idx] = 1;
                    currCount++;
                    //cout << "CurrCount = " << currCount << endl;
                }
            }
        }
        return currMax;
    }
};

